import './App.css';
import { Routes, Route } from 'react-router-dom';
import Layout from './Components/Layout/Layout';

function App() {
  return (
    <div>
     <Routes>
       <Route exact path = "/" element = {<Layout />}>
       </Route>
     </Routes>
    </div>
  );
}

export default App;
